import React from "react";
const portfolio = "../../portfolio.json";

function Card() {
  return this.portfolio.map((item) => (
    <div className="s12 col m4">
      <div className="card-image">
        <img src={item.image} />
      </div>
      <div className="card-content">
        <p>
          <b>{item.name}</b>
          {item.description}
        </p>
        <br />
        <i>
          <a href={item.ghlink}>Github</a>
        </i>
        <i>
          <a href={item.deployed}>Deployed site</a>
        </i>
      </div>
    </div>
  ));
}

export default Card;
